import styled from 'styled-components'

export const MainSection = styled.div`
    width: 100%;
    height: 100vh;
    background: #000;
    padding: 1px 0;

`
export const ListSection = styled.div`
    & .list-group-item{
        width: 100%;
    background:rgb(4, 112, 212);
    }
   

`
export const MainSectionInner = styled.div`
    width: 50%;
    margin: 40px auto;

    & .card{
        background-color: #fff;
    }

`
